import logo from "./logo.svg";
import "./App.css";
import Login from './components/login';
import Test from './components/Nav';
import {Route, Link, Switch, BrowserRouter as Router} from 'react-router-dom';

function App() {
return (
<Router>
    <div className="App">
        <h1><Link to="/">Test</Link></h1>
        <div>
            <Switch>
                <Route exact path="/">
                    <Test />
                </Route>
            </Switch>
        </div>
    </div>
</Router>
);
}


export default App;
